    {
        ArgsCompatbilityReport report = areArgsCompatible(getArgClasses(args), classes, null);
        if (report == null)
            return false;
        for (boolean conversionNeeded : report.conversionNeeded)
            if (conversionNeeded)
                return false;
        return true;
    }

private Node<T> findInternal(Node<T> parent, NodePredicate<T> predicate) {
        if (parent != null) {
            if (predicate.appliesTo(parent)) {
